import React from 'react'
import { Box,Typography,Stack } from '@mui/material'
import HorizontalScrollBar from './HorizontalScrollBar'
import Loader from './Loader' 


const SimilarExercises = (targetMuscleExercises, equipmentExercises) => {
  return (
    <Box sx={{ mt: { lg: '100px', xs: '0' }}}>
      <Typography variant='h5' mb={5}>Exercises that target the same muscle group</Typography>
      <Stack direction='row' sx={{ p: 2, position: 'relative' }}>
          {targetMuscleExercises.length ? <HorizontalScrollBar
            data={targetMuscleExercises}
            />:<Loader/>
          }
        
      </Stack>

      <Typography variant='h5' mb={5}>Exercises that target the same equipment</Typography>
      <Stack direction='row' sx={{ p: 2, position: 'relative' }}>
          {targetMuscleExercises.length ? <HorizontalScrollBar
            data={equipmentExercises}
            />:<Loader/>
          }
        
      </Stack>
    </Box>
  )
}

export default SimilarExercises
